%[text] # S10 Filtros digitales
%[text] ## Importar
%[text] ![](text:image:2cd8)
%[text] Desde osciloscopio Rigol
%Señales con ruido
noise_pink_sin = readmatrix("data/sin_pn.CSV");
noise_white_sin = readmatrix("data/sin_wn.CSV");
fs_noise = 1/1.000E-06 %Hz %[output:9f138d3e]
N_noise = length(noise_white_sin);

%[text] ![](text:image:698a)
%[text] Desde la grabación de audio
%Importar audio owl.mp3
[owl,fs_owl] = audioread("data/Owl.wav");
N_owl = length(owl);

%[text] Señal del filtro resonante
%[text] ![](text:image:4f70)
res_filter = readmatrix("data/scope_csv_27_0.csv");
N_res = length(res_filter);
fs_res = 1/res_filter(1,1);
res_filter = res_filter(:,2);
%%
%[text] ## Promedio movil
%[text] ![](text:image:286c)
%Antes del promedio móvil
figure %[output:171e6323]
plot(noise_pink_sin) %[output:5d31156a] %[output:171e6323]

periodogram(noise_pink_sin,rectwin(N_noise),N_noise,fs_noise) %[output:017f0a5a]

%Aplicar promedio movil y comparar en tiempo y frecuencia

sin_mov_mean_1 = movmean(noise_pink_sin,10);
sin_mov_mean_2 = movmean(noise_pink_sin,100);
sin_mov_mean_3 = movmean(noise_pink_sin,1000);

figure %[output:454204ea]
plot([noise_pink_sin, ... %[output:454204ea]
    sin_mov_mean_1, ... %[output:454204ea]
    sin_mov_mean_2, ... %[output:454204ea]
    sin_mov_mean_3]) %[output:454204ea]
legend("Original", ... %[output:group:483433d8] %[output:454204ea]
    "Promedio movil 10", ... %[output:454204ea]
    "Promedio movil 100", ... %[output:454204ea]
    "Promedio movil 1000") %[output:group:483433d8] %[output:454204ea]


periodogram([noise_pink_sin, ... %[output:6103ab98]
    sin_mov_mean_1, ... %[output:6103ab98]
    sin_mov_mean_2, ... %[output:6103ab98]
    sin_mov_mean_3],rectwin(N_noise),100*N_noise,fs_noise) %[output:6103ab98]
xlim([0 10]) %[output:6103ab98]

periodogram([noise_pink_sin],rectwin(N_noise),100*N_noise,fs_noise) %[output:8a459102]
xlim([0 10]) %[output:8a459102]

%%
%[text] ## Savitzky-Golay
%[text] ![](text:image:3c4d)
%Aplicar sgolay a una señal sinusoidal ruidosa.
%Comparar resultado contra promedio movil en tiempo y frecuencia
sin_sg_1 = sgolayfilt(noise_pink_sin,3,111);
sin_sg_2 = sgolayfilt(noise_pink_sin,5,111);

figure %[output:45b95a34]
plot([noise_pink_sin sin_sg_1 sin_sg_2]) %[output:45b95a34]

%Comparar con promedio movil
figure %[output:7b1e3fc6]
plot([noise_pink_sin sin_mov_mean_2 sin_sg_2]) %[output:7b1e3fc6]


%%
%[text] ## Filtro resonante
%Determinar la frecuencia de resonancia (oscilacion pequeña) del filtro
%resonante
res_filter_clean = sgolayfilt(res_filter,2,31);


figure  %[output:16fc7ba9]
plot(res_filter_clean) %[output:16fc7ba9]

[pxx,f] = periodogram(res_filter_clean,rectwin(N_res),100*N_res,fs_res);
plot(f,pxx) %[output:160eaa36]

win= N_res*0.3;
overlap = ceil(win*0.9);

spectrogram(res_filter_clean,win,overlap,N_res*1000,fs_res,'yaxis') %[output:75eab690]
ylim([0 50]) %[output:75eab690]
%%
%[text] ## Diseño de filtros
%[text] ![](text:image:1312)
%Diseñar un filtro que elimine exactamente la oscilacion del filtro
%resonante

%filt = designfilt()
filt = designfilt('bandstopiir','PassbandFrequency1',1000,'StopbandFrequency1',1050,'StopbandFrequency2',1950,'PassbandFrequency2',2000,'PassbandRipple1',0.1,'StopbandAttenuation',60,'PassbandRipple2',0.1,'SampleRate',1250000);
%%
%[text] ## Aplicar filtro
%[text] ![](text:image:0645)
%[text] filter(filtro,x)
res_filter_filtered = filter(filt,res_filter);

figure %[output:028cc9dc]
plot(res_filter_filtered) %[output:028cc9dc]

%%
%[text] ## Buho
%[text] ![](text:image:6174)
%Mirar el contenido espectral del audio del buho con el periodograma y el
%espectrograma

%Escuchar el audio
%sound()

%%
%[text] ## Diseño de filtro 2
%Diseñar un filtro para eliminar la banda del buho
%Diseñar un filtro para eliminar la banda de los pajaritos
filt_buho = designfilt('highpassiir','StopbandFrequency',1500,'PassbandFrequency',1600,'StopbandAttenuation',60,'PassbandRipple',1,'SampleRate',22050);
filt_pajaros = designfilt('lowpassiir','PassbandFrequency',1500,'StopbandFrequency',1600,'PassbandRipple',1,'StopbandAttenuation',60,'SampleRate',22050);

%%
%[text] ## Aplicar filtro 2
%Aplicar ambos filtros

sig_no_buho = filter(filt_buho,owl(:,1));
sig_no_pajaros = filter(filt_pajaros,owl(:,1));
%%
%[text] ## Verificar resultados
%Escuchar los resultados y visualizarlos con espectrograma y periodograma
%Cuidado, porque la RAM se desborda con los espectrogramas

win= N_owl*0.1;
overlap = ceil(win*0.9);
spectrogram(sig_no_buho,win,overlap,N_owl*10,fs_owl,'yaxis') %[output:1be0282a]
set(gca,'CLim',[-100 -17]); %[output:1be0282a]


%sound(sig_no_buho,fs_owl)


win= N_owl*0.1;
overlap = ceil(win*0.9);
spectrogram(sig_no_pajaros,win,overlap,N_owl*10,fs_owl,'yaxis') %[output:39c6e6a1]
set(gca,'CLim',[-100 -17]); %[output:39c6e6a1]


%sound(sig_no_pajaros,fs_owl)
